import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom'
import Tiles from './tile';
import ClientViewer from './clientViewer';
import Login from './login';
import UserDashBoard from './users';
import CustomerDashBoard from './customers';
import FileDashBoard from './fileup';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/users" element={<UserDashBoard/>} />
        <Route path="/customers" element={<CustomerDashBoard/>} />
        <Route path="/file" element={<FileDashBoard/>} />
        <Route path="/tile" element={<Tiles />} />
        <Route path="/login" element={<Login />} />
        <Route path="/clientViewer" element={<ClientViewer />} />
        <Route path="/" element={<Navigate to="/login" />} />
      </Routes>
    </Router>
  );
}

export default App;



